/*
import React from "react";
import './login.css';
import getUser from "../../Service/userService";


const LoginApp = () => {

    return (

        <div className='container'>

            <div className='header'>

                <div className='text'>

                    LogIn
                </div>

                <div className='inputs'>

                    <div className='input'>

                        <input value = 'userid' type='email' placeholder="Email Id"></input>

                    </div>

                    <div className='input'>

                        <input value = 'pass' type='password' placeholder="Password"></input>

                    </div>

                    <div className="submit-container">

                        <div className="submit">

                            <button onClick={getUser}>login</button>

                        </div>
                    </div>

                </div>

            </div>
        </div>
    );

}


export default LoginApp;
*/
